import React from 'react';
import {Link } from 'react-router-dom'; 
import './App.css';

/*https://www.freecodecamp.org/news/react-router-tutorial/*/
class Navbar extends React.Component {
    render(){
    return(
            <div className="Navbar">
                  {/* Set up the Links*/}
                  <h1>DesignY</h1>
                  <ul>
                    <Link to="/Home" className="item"><button class="button">Home</button></Link>
                    <Link to="/Projects" className="item"><button class="button">Projects</button></Link>
                    <Link to="/articles" className="item"><button class="button">Articles</button></Link>
                    <Link to="/about" className="item"><button class="button">About</button></Link>
                  </ul>
                  
            </div>
    )
    }
}
export default Navbar;
